import{_ as t,o as e,c as r,e as d}from"./app-bd32c210.js";const n={},o=d('<p>#PHP</p><table><thead><tr><th style="text-align:center;">名字</th><th style="text-align:center;">说明</th></tr></thead><tbody><tr><td style="text-align:center;"><strong><code>__LINE__</code></strong></td><td style="text-align:center;">文件中的当前行号。</td></tr><tr><td style="text-align:center;"><strong><code>__FILE__</code></strong></td><td style="text-align:center;">文件的完整路径和文件名。如果用在被包含文件中，则返回被包含的文件名。</td></tr><tr><td style="text-align:center;"><strong><code>__DIR__</code></strong></td><td style="text-align:center;">文件所在的目录。如果用在被包括文件中，则返回被包括的文件所在的目录。它等价于 <code>dirname(__FILE__)</code>。除非是根目录，否则目录中名不包括末尾的斜杠。</td></tr><tr><td style="text-align:center;"><strong><code>__FUNCTION__</code></strong></td><td style="text-align:center;">当前函数的名称。匿名函数则为 <code>{closure}</code>。</td></tr><tr><td style="text-align:center;"><strong><code>__CLASS__</code></strong></td><td style="text-align:center;">当前类的名称。类名包括其被声明的作用域（例如 <code>Foo\\Bar</code>）。当用在 trait 方法中时，<strong>CLASS</strong> 是调用 trait 方法的类的名字。</td></tr><tr><td style="text-align:center;"><strong><code>__TRAIT__</code></strong></td><td style="text-align:center;">Trait 的名字。Trait 名包括其被声明的作用域（例如 <code>Foo\\Bar</code>）。</td></tr><tr><td style="text-align:center;"><strong><code>__METHOD__</code></strong></td><td style="text-align:center;">类的方法名。</td></tr><tr><td style="text-align:center;"><strong><code>__NAMESPACE__</code></strong></td><td style="text-align:center;">当前命名空间的名称。</td></tr><tr><td style="text-align:center;"><strong><code>ClassName::class</code></strong></td><td style="text-align:center;">完整的类名。</td></tr></tbody></table>',2),c=[o];function s(_,l){return e(),r("div",null,c)}const g=t(n,[["render",s],["__file","魔术常量.html.vue"]]);export{g as default};
